import React from 'react';
import API from "../utils/API";
import { Button, Card } from 'react-bootstrap';


let itemsincart = [];
API.loadCart(itemsincart)
function Cart() {
  return (
    <React.Fragment> 
      <center><h1>Cart Page</h1></center>

      <Card style={{ width: '18rem' }}>
          <Card.Img variant="top" src="{image}" style="{picturewidth}" />
          <Card.Body>
            <Card.Title>name</Card.Title>
            <Card.Text>price</Card.Text>
            <Button variant="primary" href="{link}">Item Link</Button>
            <br></br><br></br>
            <Button variant="secondary" onClick="{cartfunction}">Add to Cart</Button>
          </Card.Body>
        </Card>

    </React.Fragment>
   );
}

export default Cart;
